import React, { useRef, useState } from 'react';
import { useFrame, useLoader } from '@react-three/fiber';
import { Html, TextureLoader } from '@react-three/drei';

function InteractivePlanet({ position, content }) {
  const mesh = useRef();
  const [hovered, setHovered] = useState(false);
  const [active, setActive] = useState(false);
  const texture = useLoader(TextureLoader, content.texture);

  useFrame(() => {
    mesh.current.rotation.x += 0.01;
    mesh.current.rotation.y += 0.01;
  });

  return (
    <mesh
      position={position}
      ref={mesh}
      scale={active ? 1.5 : 1}
      onClick={() => setActive(!active)}
      onPointerOver={() => setHovered(true)}
      onPointerOut={() => setHovered(false)}
    >
      <sphereGeometry args={[1, 32, 32]} />
      <meshStandardMaterial map={texture} />
      {active && (
        <Html position={[0, 0, 1.5]}>
          <div className="content">
            {content.text && <p>{content.text}</p>}
            {content.image && <img src={content.image} alt="Planet content" />}
            {content.video && <video src={content.video} controls />}
            {content.link && <a href={content.link} target="_blank" rel="noopener noreferrer">{content.link}</a>}
          </div>
        </Html>
      )}
    </mesh>
  );
}

export default InteractivePlanet;

